import React, { Component } from 'react'
import "bootstrap/dist/css/bootstrap.min.css";
import axios from 'axios';
import { Link } from 'react-router-dom';
const url1 = "http://localhost:4000/movieList/";
export default class ViewBooking extends Component {
    state={
        movies:[],
        errormessage:""
    };
    fetchMovies = () => {
        axios.get(url1)
        .then((res)=>{
            this.setState({
                movies:res.data,
            });
        })
        .catch((err)=>{
            console.log("Error :",err);
        });
    };
    componentDidMount() {
        this.fetchMovies();
      }
  render() {
    
    return (
        <>
        <div className="card text-white">
      <center>
  <img className="card-img" src="data:image/png;base64," alt="Card image"
  style={{"height" : "330px", "width" : "700px"}} />
  </center>
</div>
        <div className="container p-3">
          <div className="row">
          
            {this.state.movies.map((movie) => (
              
              <div className="col-md-3 col-sm-3 mb-1">
                <div className="card col">
                  <div className="card-header">
                    <h5 className='card-title'>{movie.movieName}</h5></div>
                  <div className="card-body">
                    <center><img src={movie.path} style={{"height" : "200px", "width" : "200px"}}/></center>
                    <br/>
                    <h5 className="card-title">
                      Movie Id : {movie.movieId}
                    </h5>
                    <p className="card-text">Cost : Rs. {movie.cost}</p>
                    <button className="btn btn-primary"  onClick={() =>this.props.history.push(`ticketbooking/${movie.movieId}`)} style={{"width" : "220px"}}>
                    Book Tickets
                    </button>
                    <a href={movie.movieLink}><button className="btn btn-primary" style={{"width" : "220px"}}>
                    Movie Trailer
                    </button></a>
                    {/**/}
                  </div>
                </div>
              </div>
            ))}
          </div>
        <div align="center">
           {/* Display rror message as given in QP */}
        </div>
      </div>
      </>
    )
  }
}
